import React from 'react';
import '.Article'

const Article = (props) => ( 
    <div>
        <h1 class="headline"> { props.title } </h1> 
        <span class="author">by { props.author }</span>
        <br/>
        <span class="date"> { props.date } </span> 
        <hr/>
        <p> { props.children } </p> 
    </div>
);

export default Article;
